import React from 'react';
import s from './ModelPhoto.module.css';
import Slider from 'react-slick';
const ModelPhoto =()=>{
    let settings = {
        dots:false,
        infinite:true,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'82px'
    };
    return(
<Slider {...settings}>
<div></div>
</Slider>
    );
};

export default ModelPhoto;
